(2, 'Intel', 'We deliver AI experiences that power businesses with industry-defining platforms. With 50 years of unmatched innovation and global scale, you get the reliability and resilience you need to launch into a future full of creativity and ingenuity.', 'https://stage-lms.sumedhait.com/administrator/1/admin-placement', NULL, 'Technology', '1000+', 'Vamsi Viswanath', 'hr', 'vamsi.k@sumedhait.com', '8121950115', 'Hyderabad JNTU', 'Hyderabad JNTU', 'Hyderabad', 'Telangana', 'India', 'dsff', 'sumedha@1.com', '1231244', '3434', 'new', 'https://stage-lms.sumedhait.com/administrator/1/admin-placement', 'https://stage-lms.sumedhait.com/administrator/1/admin-placement', 1, '2025-08-11 16:31:49', '2025-08-22 18:05:54'),
(3, 'Risetime Semiconductors', 'Risetime was founded by a group of committed and experienced semiconductor industry professionals with a goal to provide end to end design and engineering services. Founding members have in depth knowledge and decades of experience in Custom Layout Design, ASIC Design, RTL Design, Verification,  post silicon validation, Physical Design, DFT, FPGA Emulation,  Board Design, Analog & Mixed Signal Design and Embedded Software services etc. Since inception the team has been working with various companies in the eco system on engineering services, technology solutions and product development.\n\n \nExperienced technical leads and proactive management ensures our engineers and processes are up to date and ready to work on any complex projects.\n\nThe company is built on back of high quality technical team with a great track record and follow strict corporate values and code of conduct.\n\nMission\n To stand out as a leading services company that can provide end to end solutions in semiconductor industry, i.e concept to silicon.\n\n \nVision\n To be a successful product development company which is capable of providing spec to consumer level product with highest level of quality to automotive, industrial/consumer electronics, storage and telecom verticals.', 'https://risetime.in/', NULL, 'Technology', '51-200', 'Vamsi', NULL, 'vamsi.a@sumedhait.com', '8790905787', 'Risetime Semiconductor OPC Pvt Ltd #302/A, Fortune Signature Towers,\nBeside JNTU Metrostation,\nHyderabad,Telangana – 500085', '', '', '', '', '', '', '', NULL, '', NULL, NULL, 1, '2025-08-13 12:32:46', '2025-08-13 12:32:46'),
(4, 'Chipex', 'Chipex', 'https://sumedhait.com/', NULL, NULL, '11-50', 'Vamsi Kumar', 'HR', 'chipex@gmail.com', '9988776655', 'Hyderabad', '', '', '', '', '', '', '', NULL, '', NULL, NULL, 0, '2025-08-21 11:42:01', '2025-08-21 11:42:45');
