INSERT INTO `job_postings` (`id`, `company_id`, `course_id`, `posted_by`, `title`, `description`, `requirements`, `responsibilities`, `job_type`, `location`, `salary_min`, `salary_max`, `experience_required`, `vacancies`, `status`, `application_deadline`, `eligible_courses`, `specializations`, `backlogs_allowed`, `training_period_stipend`, `bond_service_agreement`, `mandatory_original_documents`, `recruitment_process_steps`, `mode_of_recruitment`, `interview_date`, `interview_mode`, `venue_link`, `btech_year_of_passout_min`, `btech_year_of_passout_max`, `mtech_year_of_passout_min`, `mtech_year_of_passout_max`, `btech_percentage_min`, `mtech_percentage_min`, `skills_required`, `additional_criteria`, `created_at`, `updated_at`) VALUES
(4, 3, 38, 1, 'DV Engineer', '', 'About the Role:\nWe are seeking a highly motivated Design Verification Engineer to join our VLSI team. The candidate will be responsible for verifying complex digital designs, developing robust verification environments, and ensuring first-pass silicon success. This role requires strong expertise in verification methodologies, testbench development, and debugging at the block, subsystem, and SoC level.\nKey Responsibilities:\nDevelop and implement verification testbenches using SystemVerilog/UVM.\nCreate and execute test plans, define coverage metrics, and achieve closure.\nPerform block-level, subsystem-level, and SoC-level verification.\nWrite, run, and debug test cases for functional and performance verification.\nWork closely with RTL design engineers to understand specifications and resolve issues.\nConduct code reviews, assertion-based verification (ABV), and coverage analysis.\nAutomate regression environments and support continuous integration.\nEnsure verification quality standards and contribute to best practices.\nRequired Skills & Qualifications:\nBachelor’s or Master’s degree in Electronics, Electrical, or Computer Engineering.\nStrong understanding of digital design concepts (RTL, FSMs, pipelines, clocking).\nProficiency in SystemVerilog, UVM, and OOP-based verification methodologies.\nExperience with simulation tools (VCS, Questa, Incisive, etc.).\nKnowledge of scripting languages (Python, Perl, Shell, or TCL).\nFamiliarity with waveform debugging tools (DVE, SimVision, Verdi).\nGood understanding of coverage-driven verification and assertion-based verification.\nExcellent problem-solving, debugging, and communication skills.\nPreferred/Good to Have:\nExposure to low-power verification (UPF/CPF).\nKnowledge of formal verification techniques.\nExperience in SoC-level verification, bus protocols (AXI, AHB, APB, PCIe, USB, DDR, etc.).\nPrior experience with regression management tools (Jenkins, Makefiles, etc.).\nWhy Join Us?\nOpportunity to work on cutting-edge semiconductor technologies.\nCollaborative work culture with continuous learning and innovation.\nCompetitive compensation and career growth.', NULL, 'full_time', 'Hyderabad', 300000.00, 400000.00, '0', 5, 'open', NULL, '\"[\\\"B.Tech\\\"]\"', '\"[\\\"ECE\\\"]\"', 'No', 15000.00, 'THERE IS NO BOND', 'Yes', 'ONLINE', 'Online', NULL, 'Online', 'HYDERABAD', 2023, 2025, NULL, NULL, 60.00, NULL, '\"[]\"', NULL, '2025-08-26 12:05:00', '2025-08-26 13:49:45'),
(5, 4, 36, 1, 'PD ENGINEER', '', 'About the Role:\nWe are seeking a highly motivated Design Verification Engineer to join our VLSI team. The candidate will be responsible for verifying complex digital designs, developing robust verification environments, and ensuring first-pass silicon success. This role requires strong expertise in verification methodologies, testbench development, and debugging at the block, subsystem, and SoC level.\nKey Responsibilities:\nDevelop and implement verification testbenches using SystemVerilog/UVM.\nCreate and execute test plans, define coverage metrics, and achieve closure.\nPerform block-level, subsystem-level, and SoC-level verification.\nWrite, run, and debug test cases for functional and performance verification.\nWork closely with RTL design engineers to understand specifications and resolve issues.\nConduct code reviews, assertion-based verification (ABV), and coverage analysis.\nAutomate regression environments and support continuous integration.\nEnsure verification quality standards and contribute to best practices.\nRequired Skills & Qualifications:\nBachelor’s or Master’s degree in Electronics, Electrical, or Computer Engineering.\nStrong understanding of digital design concepts (RTL, FSMs, pipelines, clocking).\nProficiency in SystemVerilog, UVM, and OOP-based verification methodologies.\nExperience with simulation tools (VCS, Questa, Incisive, etc.).\nKnowledge of scripting languages (Python, Perl, Shell, or TCL).\nFamiliarity with waveform debugging tools (DVE, SimVision, Verdi).\nGood understanding of coverage-driven verification and assertion-based verification.\nExcellent problem-solving, debugging, and communication skills.\nPreferred/Good to Have:\nExposure to low-power verification (UPF/CPF).\nKnowledge of formal verification techniques.\nExperience in SoC-level verification, bus protocols (AXI, AHB, APB, PCIe, USB, DDR, etc.).\nPrior experience with regression management tools (Jenkins, Makefiles, etc.).\nWhy Join Us?\nOpportunity to work on cutting-edge semiconductor technologies.\nCollaborative work culture with continuous learning and innovation.\nCompetitive compensation and career growth.', NULL, 'full_time', 'HYDERABAD', 400000.00, 600000.00, '0', 5, 'open', '2025-09-10 00:00:00', '\"[\\\"B.Tech\\\"]\"', '\"[\\\"EEE\\\"]\"', 'Yes', 15000.00, 'NO BOND', 'Yes', NULL, 'Online', '2025-09-19', 'Online', 'HYDERABAD', 2023, 2025, 2024, NULL, 60.00, NULL, '\"[]\"', 'NOTHING', '2025-08-26 12:13:03', '2025-08-26 12:13:03');
