(11, 76, 'Project on AI', 'This project focuses on building an AI-powered system to automatically detect and classify defects in semiconductor wafers during the manufacturing process. Manual inspection is time-consuming and prone to error; hence, the integration of AI offers speed, accuracy, and scalability.\r\n\r\nThe model is trained using a dataset of wafer inspection images, applying image processing techniques along with Convolutional Neural Networks (CNNs) to identify common manufacturing defects such as scratches, particles, pattern deviations, and contamination.\r\n\r\nThis solution can be integrated into VLSI manufacturing and testing lines to minimize yield loss and improve quality control.', 'Figma', NULL, '2025-02-07', '2025-05-28', NULL, 'Personal', 'Sumedha IT', '2025-05-29 14:21:31', '2025-05-29 14:21:31', '[{\"name\":\"Clock Tree Synthesis.pdf\",\"path\":\"project-files\\/76\\/Meb2KpL57rlZbFLnVcLOj9PyJr4c9Kwf4Rlmc8ML.pdf\",\"mime_type\":\"application\\/pdf\",\"size\":804302}]'),
